func TestRecursiveQuickSortBaseCase(t *testing.T) {
	array := []int{0}
	startTime := time.Now()
	quicksort(array, 0, 0)
	timeDiff := time.Now().Sub(startTime)
	// Average runtime: 300ns
	t.Logf("The time taken to test 10,000 numbers is %v", timeDiff)
	if !reflect.DeepEqual(array, []int{0}) {
		t.Fail()
	}
}

